def unscramble(C):
    A = C
    i = len(A) - 1
    while i >= 2:
        A[i-1].pop()
        A.insert(i-1, A[i-2].pop())
        i -= 1
    return A


def hex_to_ascii(hex_list):
    return ''.join([chr(int(h.pop(0), 16)) if isinstance(h, list) else chr(int(h, 16))
                    for h in hex_list])


